       k2=rnorm(1, mean=1.0, sd=0.5),
       k3=rnorm(1, mean=1.0, sd=0.5),
       k4=rnorm(1, mean=1.0, sd=0.5)) # entries are named as k1, k2, k3 and k4
################################################################################

################################################################################
m <- function(K){
  V <- K["k1"]*x + K["k2"]*x^2 + K["k3"]*x^3 + K["k4"]*x^4
  return(V)
}
