u <- function(V){
  Q <- sqrt( mean((V-y)^2)  )
  E <- Q # For RMSD, <-> negative sign or other mathematical operation
         # is not needed.

  RESULT <- NULL
  RESULT$Q <- Q
  RESULT$E <- E
  return(RESULT)
